// src/nodes/MathNode.js
import React from "react";
import BaseNode from "./BaseNode";

export default function MathNode({ id, data }) {
  return (
    <BaseNode
      id={id}
      data={{
        title: "Math",
        subtitle: data?.op || "add",
        inputs: [
          { id: `${id}-a`, label: "a" },
          { id: `${id}-b`, label: "b" },
        ],
        outputs: [{ id: `${id}-out`, label: "result" }],
        children: <div>Performs a simple math op (demo).</div>,
      }}
    />
  );
}
